INSERT INTO `modelo_documento` VALUES (11,'<div title=\"header\">\r\n<p align=\"left\"><img style=\"width: 204px;\" src=\"../Images/Pine1.jpg\" /></p>\r\n</div>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">[(#CAMPO_DATA#)]</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><span lang=\"es-MX\">A/C SESI</span></p>\r\n<p class=\"x_x_x_x_x_x_western\" lang=\"es-MX\" align=\"left\">ATT. Sra. Carine / Denise / <span style=\"background-color: #800000;\">Melissa</span></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">Ref.:Cota&ccedil;&atilde;o de Pre&ccedil;os com satisfa&ccedil;&atilde;o submetemos &agrave; aprecia&ccedil;&atilde;o de V. Sas, pre&ccedil;os de nossos servi&ccedil;os/mercadorias</p>\r\n<p class=\"x_x_x_x_x_x_western\" lang=\"pt-BR\" align=\"left\"><img src=\"../Images/Pine3.png\" width=\"144\" height=\"231\" name=\"x_x_x_x_x_x_Figura1\" align=\"left\" border=\"0\" hspace=\"12\" /></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><img src=\"../Images/Pine4.png\" width=\"211\" height=\"291\" name=\"x_x_x_x_x_x_Figura2\" align=\"left\" border=\"0\" hspace=\"12\" /> <img src=\"Bobson%20Pine_html_b34613e50d91424e.png\" width=\"520\" height=\"50\" name=\"x_x_x_x_x_x_Figura3\" align=\"bottom\" border=\"0\" /></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">Limpador Desengraxante Neutro LAVA GRAXAS</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">S<img src=\"../Images/Pine2.png\" width=\"201\" height=\"60\" name=\"x_x_x_x_x_x_Figura4\" align=\"left\" border=\"0\" hspace=\"12\" /> uper Concentrado LAVA CARRO</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">Elaborado com Terpeno de Pinho LAVA PISOS</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">(Um Solvente Natural extra&iacute;do da folha do Pinho) LAVA VIDROS</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">Dilui&ccedil;&atilde;o 1 ate 400 LAVA BANHEIRO</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">Indicado para todo tipo de Sujidade LAVA PAREDES</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<h1>Aten&ccedil;&atilde;o L&acute;L&eacute;L&iacute;L&oacute;L&uacute; &nbsp;[(#CAMPO_LIVRE#)]</h1>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<h3><span style=\"font-size: xx-large;\">Pre&ccedil;o somente<strong>&nbsp;</strong></span><strong>[(#CAMPO_LIVRE#)]</strong></h3>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><span style=\"font-size: xx-large;\">R$ 45,00 / 1000 L (&aacute;gua,m&eacute;dia de dilui&ccedil;&atilde;o 1) custo 0,04 centavos o litro</span></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><span style=\"font-size: xx-large;\">R$ 45,00 / 500 (&aacute;gua,m&eacute;dia de dilui&ccedil;&atilde;o 2) custo 0,08 centavos o litro</span></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"justify\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><img style=\"width: 121px;\" src=\"data:image/jpeg;base64,\" data-filename=\"fav2.jpg\" /></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<h1>[(#CAMPO_LIVRE#)]</h1>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><span style=\"font-size: large;\">Ateosamente</span></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">&nbsp;</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\">[(#CAMPO_LIVRE#)]</p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"left\"><span style=\"font-size: large;\">Gerente Nacional de Vendas</span></p>\r\n<div title=\"footer\">\r\n<p lang=\"pt-BR\" align=\"left\"><img src=\"Bobson%20Pine_html_d850e0d2787023bb.gif\" align=\"left\" hspace=\"12\" /></p>\r\n<p class=\"x_x_x_x_x_x_western\" align=\"justify\"><span style=\"font-family: Verdana, sans-serif;\"><span style=\"font-size: xx-small;\"><span lang=\"pt-BR\"><strong>SAO P