CREATE DEFINER=`bobson01`@`%` PROCEDURE `sp_aros_listar_remessas`(
IN in_local int,
in in_data_inicio date,
in in_data_fim date

)
BEGIN
   select 
    id,
    numero_controle,
	origem,
    (select nome from aros_filiais where id = origem) as desc_origem,
	destino,
    (select nome from aros_filiais where id = destino) as desc_destino,
	forma_envio,
    (select nome from aros_transportes where id = forma_envio) as desc_forma_envio,
	descricao_objeto,
	data_envio,
	responsavel_envio,
	data_recebimento,
	responsavel_recebimento,
    observacoes
   from aros_remessa 
   where (aros_remessa.origem = in_local or aros_remessa.destino = in_local ) and (date(aros_remessa.data_envio) between in_data_inicio and in_data_fim or date(aros_remessa.data_recebimento) between in_data_inicio and in_data_fim);
END ;;
DELIMITER ;
